INSERT INTO obs_column (cartodb_id, the_geom, the_geom_webmercator, id, type, name, description, weight, aggregate, version, extra) VALUES (683, NULL, NULL, '"us.census.acs"."us.census.acs".B08006009_quant', 'Numeric', 'Quantile:Commuters by Bus', 'The number of workers age 16 years and over within a geographic area who primarily traveled to work by bus.  This is the principal mode of travel or type of conveyance, by distance rather than time, that the worker usually used to get from home to work.  This is a subset of workers who commuted by public transport.', 0, 'quantile', '0', NULL);
INSERT INTO obs_column (cartodb_id, the_geom, the_geom_webmercator, id, type, name, description, weight, aggregate, version, extra) VALUES (684, NULL, NULL, '"us.census.acs"."us.census.acs".B08006011_quant', 'Numeric', 'Quantile:Commuters by Subway or Elevated', 'The number of workers age 16 years and over within a geographic area who primarily traveled to work by subway or elevated train.  This is the principal mode of travel or type of conveyance, by distance rather than time, that the worker usually used to get from home to work.  This is a subset of workers who commuted by public transport.', 0, 'quantile', '0', NULL);
INSERT INTO obs_column (cartodb_id, the_geom, the_geom_webmercator, id, type, name, description, weight, aggregate, version, extra) VALUES (685, NULL, NULL, '"us.census.acs"."us.census.acs".B08006015_quant', 'Numeric', 'Quantile:Walked to Work', 'The number of workers age 16 years and over within a geographic area who primarily walked to work.  This would mean that of any way of getting to work, they travelled the most distance walking.', 0, 'quantile', '0', NULL);
INSERT INTO obs_column (cartodb_id, the_geom, the_geom_webmercator, id, type, name, description, weight, aggregate, version, extra) VALUES (686, NULL, NULL, '"us.census.acs"."us.census.acs".B08006017_quant', 'Numeric', 'Quantile:Worked at Home', 'The count within a geographical area of workers over the age of 16 who worked at home.', 0, 'quantile', '0', NULL);
INSERT INTO obs_column (cartodb_id, the_geom, the_geom_webmercator, id, type, name, description, weight, aggregate, version, extra) VALUES (687, NULL, NULL, '"us.census.acs"."us.census.acs".B09001001_quant', 'Numeric', 'Quantile:children under 18 Years of Age', 'The number of people within each geography who are under 18 years of age.', 0, 'quantile', '0', NULL);
INSERT INTO obs_column (cartodb_id, the_geom, the_geom_webmercator, id, type, name, description, weight, aggregate, version, extra) VALUES (688, NULL, NULL, '"us.census.acs"."us.census.acs".B11001001_quant', 'Numeric', 'Quantile:Households', 'A count of the number of households in each geography. A household consists of one or more people who live in the same dwelling and also share at meals or living accommodation, and may consist of a single family or some other grouping of people. ', 0, 'quantile', '0', NULL);
INSERT INTO obs_column (cartodb_id, the_geom, the_geom_webmercator, id, type, name, description, weight, aggregate, version, extra) VALUES (689, NULL, NULL, '"us.census.acs"."us.census.acs".B14001001_quant', 'Numeric', 'Quantile:Population 3 Years and Over', 'The total number of people in each geography age 3 years and over.  This denominator is mostly used to calculate rates of school enrollment.', 0, 'quantile', '0', NULL);
INSERT INTO obs_column (cartodb_id, the_geom, the_geom_webmercator, id, type, name, description, weight, aggregate, version, extra) VALUES (690, NULL, NULL, '"us.census.acs"."us.census.acs".B14001002_quant', 'Numeric', 'Quantile:Students Enrolled in School', 'The total number of people in each geography currently enrolled at any level of school, from nursery or pre-school to advanced post-graduate education.  Only includes those over the age of 3.', 0, 'quantile', '0', NULL);
INSERT INTO obs_column (cartodb_id, the_geom, the_geom_webmercator, id, type, name, description, weight, aggregate, version, extra) VALUES (691, NULL, NULL, '"us.census.acs"."us.census.acs".B14001005_quant', 'Numeric', 'Quantile:Students Enrolled in Grades 1 to 4', 'The total number of people in each geography currently enrolled in grades 1 through 4 inclusive.  This corresponds roughly to elementary school.', 0, 'quantile', '0', NULL);
INSERT INTO obs_column (cartodb_id, the_geom, the_geom_webmercator, id, type, name, description, weight, aggregate, version, extra) VALUES (692, NULL, NULL, '"us.census.acs"."us.census.acs".B14001006_quant', 'Numeric', 'Quantile:Students Enrolled in Grades 5 to 8', 'The total number of people in each geography currently enrolled in grades 5 through 8 inclusive.  This corresponds roughly to middle school.', 0, 'quantile', '0', NULL);
INSERT INTO obs_column (cartodb_id, the_geom, the_geom_webmercator, id, type, name, description, weight, aggregate, version, extra) VALUES (693, NULL, NULL, '"us.census.acs"."us.census.acs".B14001007_quant', 'Numeric', 'Quantile:Students Enrolled in Grades 9 to 12', 'The total number of people in each geography currently enrolled in grades 9 through 12 inclusive.  This corresponds roughly to high school.', 0, 'quantile', '0', NULL);
INSERT INTO obs_column (cartodb_id, the_geom, the_geom_webmercator, id, type, name, description, weight, aggregate, version, extra) VALUES (694, NULL, NULL, '"us.census.acs"."us.census.acs".B14001008_quant', 'Numeric', 'Quantile:Students Enrolled as Undergraduate in College', 'The number of people in a geographic area who are enrolled in college at the undergraduate level. Enrollment refers to being registered or listed as a student in an educational program leading to a college degree. This may be a public school or college, a private school or college.', 0, 'quantile', '0', NULL);
INSERT INTO obs_column (cartodb_id, the_geom, the_geom_webmercator, id, type, name, description, weight, aggregate, version, extra) VALUES (695, NULL, NULL, '"us.census.acs"."us.census.acs".B15003001_quant', 'Numeric', 'Quantile:Population 25 Years and Over', 'The number of people in a geographic area who are over the age of 25.  This is used mostly as a denominator of educational attainment.', 0, 'quantile', '0', NULL);
INSERT INTO obs_column (cartodb_id, the_geom, the_geom_webmercator, id, type, name, description, weight, aggregate, version, extra) VALUES (696, NULL, NULL, '"us.census.acs"."us.census.acs".B15003017_quant', 'Numeric', 'Quantile:Population Completed High School', 'The number of people in a geographic area over the age of 25 who completed high school, and did not complete a more advanced degree.', 0, 'quantile', '0', NULL);
INSERT INTO obs_column (cartodb_id, the_geom, the_geom_webmercator, id, type, name, description, weight, aggregate, version, extra) VALUES (697, NULL, NULL, '"us.census.acs"."us.census.acs".B15003019_quant', 'Numeric', 'Quantile:Population completed less than one year of college, no degree', 'The number of people in a geographic area over the age of 25 who attended college for less than one year and no further.', 0, 'quantile', '0', NULL);
INSERT INTO obs_column (cartodb_id, the_geom, the_geom_webmercator, id, type, name, description, weight, aggregate, version, extra) VALUES (698, NULL, NULL, '"us.census.acs"."us.census.acs".B15003020_quant', 'Numeric', 'Quantile:Population completed more than one year of college, no degree', 'The number of people in a geographic area over the age of 25 who attended college for more than one year but did not obtain a degree', 0, 'quantile', '0', NULL);
INSERT INTO obs_column (cartodb_id, the_geom, the_geom_webmercator, id, type, name, description, weight, aggregate, version, extra) VALUES (699, NULL, NULL, '"us.census.acs"."us.census.acs".B15003021_quant', 'Numeric', 'Quantile:Population Completed Associate''s Degree', 'The number of people in a geographic area over the age of 25 who obtained a associate''s degree, and did not complete a more advanced degree.', 0, 'quantile', '0', NULL);
INSERT INTO obs_column (cartodb_id, the_geom, the_geom_webmercator, id, type, name, description, weight, aggregate, version, extra) VALUES (700, NULL, NULL, '"us.census.acs"."us.census.acs".B15003022_quant', 'Numeric', 'Quantile:Population Completed Bachelor''s Degree', 'The number of people in a geographic area over the age of 25 who obtained a bachelor''s degree, and did not complete a more advanced degree.', 0, 'quantile', '0', NULL);
INSERT INTO obs_column (cartodb_id, the_geom, the_geom_webmercator, id, type, name, description, weight, aggregate, version, extra) VALUES (701, NULL, NULL, '"us.census.acs"."us.census.acs".B15003023_quant', 'Numeric', 'Quantile:Population Completed Master''s Degree', 'The number of people in a geographic area over the age of 25 who obtained a master''s degree, but did not complete a more advanced degree.', 0, 'quantile', '0', NULL);
INSERT INTO obs_column (cartodb_id, the_geom, the_geom_webmercator, id, type, name, description, weight, aggregate, version, extra) VALUES (702, NULL, NULL, '"us.census.acs"."us.census.acs".B16001001_quant', 'Numeric', 'Quantile:Population 5 Years and Over', 'The number of people in a geographic area who are over the age of 5.  This is primarily used as a denominator of measures of language spoken at home.', 0, 'quantile', '0', NULL);
INSERT INTO obs_column (cartodb_id, the_geom, the_geom_webmercator, id, type, name, description, weight, aggregate, version, extra) VALUES (703, NULL, NULL, '"us.census.acs"."us.census.acs".B16001002_quant', 'Numeric', 'Quantile:Speaks only English at Home', 'The number of people in a geographic area over age 5 who speak only English at home.', 0, 'quantile', '0', NULL);
INSERT INTO obs_column (cartodb_id, the_geom, the_geom_webmercator, id, type, name, description, weight, aggregate, version, extra) VALUES (704, NULL, NULL, '"us.census.acs"."us.census.acs".B16001003_quant', 'Numeric', 'Quantile:Speaks Spanish at Home', 'The number of people in a geographic area over age 5 who speak Spanish at home, possibly in addition to other languages.', 0, 'quantile', '0', NULL);
INSERT INTO obs_column (cartodb_id, the_geom, the_geom_webmercator, id, type, name, description, weight, aggregate, version, extra) VALUES (705, NULL, NULL, '"us.census.acs"."us.census.acs".B17001001_quant', 'Numeric', 'Quantile:Population for Whom Poverty Status Determined', 'The number of people in each geography who could be identified as either living in poverty or not.  This should be used as the denominator when calculating poverty rates, as it excludes people for whom it was not possible to determine poverty.', 0, 'quantile', '0', NULL);
INSERT INTO obs_column (cartodb_id, the_geom, the_geom_webmercator, id, type, name, description, weight, aggregate, version, extra) VALUES (706, NULL, NULL, '"us.census.acs"."us.census.acs".B01001H012_quant', 'Numeric', 'Quantile:White Men age 45 to 54', '', 0, 'quantile', '0', NULL);
INSERT INTO obs_column (cartodb_id, the_geom, the_geom_webmercator, id, type, name, description, weight, aggregate, version, extra) VALUES (707, NULL, NULL, '"us.census.acs"."us.census.acs".B01001H013_quant', 'Numeric', 'Quantile:White Men age 55 to 64', '', 0, 'quantile', '0', NULL);
INSERT INTO obs_column (cartodb_id, the_geom, the_geom_webmercator, id, type, name, description, weight, aggregate, version, extra) VALUES (708, NULL, NULL, '"us.census.acs"."us.census.acs".B17001002_quant', 'Numeric', 'Quantile:Income In The Past 12 Months Below Poverty Level', 'The number of people in a geographic area who are part of a family (which could be just them as an individual) determined to be "in poverty" following the Office of Management and Budget''s Directive 14. (https://www.census.gov/hhes/povmeas/methodology/ombdir14.html)', 0, 'quantile', '0', NULL);
INSERT INTO obs_column (cartodb_id, the_geom, the_geom_webmercator, id, type, name, description, weight, aggregate, version, extra) VALUES (709, NULL, NULL, '"us.census.acs"."us.census.acs".B19013001_quant', 'Numeric', 'Quantile:Median Household Income in the past 12 Months', 'Within a geographic area, the median income received by every household on a regular basis before payments for personal income taxes, social security, union dues, medicare deductions, etc.  It includes income received from wages, salary, commissions, bonuses, and tips; self-employment income from own nonfarm or farm businesses, including proprietorships and partnerships; interest, dividends, net rental income, royalty income, or income from estates and trusts; Social Security or Railroad Retirement income; Supplemental Security Income (SSI); any cash public assistance or welfare payments from the state or local welfare office; retirement, survivor, or disability benefits; and any other sources of income received regularly such as Veterans'' (VA) payments, unemployment and/or worker''s compensation, child support, and alimony.', 0, 'quantile', '0', NULL);
INSERT INTO obs_column (cartodb_id, the_geom, the_geom_webmercator, id, type, name, description, weight, aggregate, version, extra) VALUES (711, NULL, NULL, '"us.census.acs"."us.census.acs".B19301001_quant', 'Numeric', 'Quantile:Per Capita Income in the past 12 Months', '', 0, 'quantile', '0', NULL);
INSERT INTO obs_column (cartodb_id, the_geom, the_geom_webmercator, id, type, name, description, weight, aggregate, version, extra) VALUES (712, NULL, NULL, '"us.census.acs"."us.census.acs".B25001001_quant', 'Numeric', 'Quantile:Housing Units', 'A count of housing units in each geography.  A housing unit is a house, an apartment, a mobile home or trailer, a group of rooms, or a single room occupied as separate living quarters, or if vacant, intended for occupancy as separate living quarters.', 0, 'quantile', '0', NULL);
INSERT INTO obs_column (cartodb_id, the_geom, the_geom_webmercator, id, type, name, description, weight, aggregate, version, extra) VALUES (713, NULL, NULL, '"us.census.acs"."us.census.acs".B25002003_quant', 'Numeric', 'Quantile:Vacant Housing Units', 'The count of vacant housing units in a geographic area. A housing unit is vacant if no one is living in it at the time of enumeration, unless its occupants are only temporarily absent. Units temporarily occupied at the time of enumeration entirely by people who have a usual residence elsewhere are also classified as vacant.', 0, 'quantile', '0', NULL);
INSERT INTO obs_column (cartodb_id, the_geom, the_geom_webmercator, id, type, name, description, weight, aggregate, version, extra) VALUES (714, NULL, NULL, '"us.census.acs"."us.census.acs".B25004002_quant', 'Numeric', 'Quantile:Vacant Housing Units for Rent', 'The count of vacant housing units in a geographic area that are for rent. A housing unit is vacant if no one is living in it at the time of enumeration, unless its occupants are only temporarily absent. Units temporarily occupied at the time of enumeration entirely by people who have a usual residence elsewhere are also classified as vacant.', 0, 'quantile', '0', NULL);
INSERT INTO obs_column (cartodb_id, the_geom, the_geom_webmercator, id, type, name, description, weight, aggregate, version, extra) VALUES (752, NULL, NULL, '"us.census.acs"."us.census.acs".B08134002_quant', 'Numeric', 'Quantile:Number of workers with less than 10 minute commute', 'The number of workers over the age of 16 who do not work from home and commute in less than 10 minutes in a geographic area', 0, 'quantile', '0', NULL);
INSERT INTO obs_column (cartodb_id, the_geom, the_geom_webmercator, id, type, name, description, weight, aggregate, version, extra) VALUES (890, NULL, NULL, '"us.census.acs"."us.census.acs".B01001H013_quantile', 'Numeric', 'Quantile:White Men age 55 to 64', '', 0, 'quantile', '0', NULL);
INSERT INTO obs_column (cartodb_id, the_geom, the_geom_webmercator, id, type, name, description, weight, aggregate, version, extra) VALUES (715, NULL, NULL, '"us.census.acs"."us.census.acs".B25004004_quant', 'Numeric', 'Quantile:Vacant Housing Units for Sale', 'The count of vacant housing units in a geographic area that are for sale. A housing unit is vacant if no one is living in it at the time of enumeration, unless its occupants are only temporarily absent. Units temporarily occupied at the time of enumeration entirely by people who have a usual residence elsewhere are also classified as vacant.', 0, 'quantile', '0', NULL);
INSERT INTO obs_column (cartodb_id, the_geom, the_geom_webmercator, id, type, name, description, weight, aggregate, version, extra) VALUES (716, NULL, NULL, '"us.census.acs"."us.census.acs".B25058001_quant', 'Numeric', 'Quantile:Median Rent', 'The median contract rent within a geographic area. The contract rent is the monthly rent agreed to or contracted for, regardless of any furnishings, utilities, fees, meals, or services that may be included. For vacant units, it is the monthly rent asked for the rental unit at the time of interview.', 0, 'quantile', '0', NULL);
INSERT INTO obs_column (cartodb_id, the_geom, the_geom_webmercator, id, type, name, description, weight, aggregate, version, extra) VALUES (717, NULL, NULL, '"us.census.acs"."us.census.acs".B25071001_quant', 'Numeric', 'Quantile:Percent of Household Income Spent on Rent', 'Within a geographic area, the median percentage of household income which was spent on gross rent.  Gross rent is the amount of the contract rent plus the estimated average monthly cost of utilities (electricity, gas, water, sewer etc.) and fuels (oil, coal, wood, etc.) if these are paid by the renter.  Household income is the sum of the income of all people 15 years and older living in the household.', 0, 'quantile', '0', NULL);
INSERT INTO obs_column (cartodb_id, the_geom, the_geom_webmercator, id, type, name, description, weight, aggregate, version, extra) VALUES (718, NULL, NULL, '"us.census.acs"."us.census.acs".B25075001_quant', 'Numeric', 'Quantile:Owner-occupied Housing Units', '', 0, 'quantile', '0', NULL);
INSERT INTO obs_column (cartodb_id, the_geom, the_geom_webmercator, id, type, name, description, weight, aggregate, version, extra) VALUES (719, NULL, NULL, '"us.census.acs"."us.census.acs".B25075025_quant', 'Numeric', 'Quantile:Owner-occupied Housing Units valued at $1,000,000 or more.', 'The count of owner occupied housing units in a geographic area that are valued at $1,000,000 or more.  Value is the respondent''s estimate of how much the property (house and lot, mobile home and lot, or condominium unit) would sell for if it were for sale.', 0, 'quantile', '0', NULL);
INSERT INTO obs_column (cartodb_id, the_geom, the_geom_webmercator, id, type, name, description, weight, aggregate, version, extra) VALUES (759, NULL, NULL, '"us.census.acs"."us.census.acs".B08134009_quant', 'Numeric', 'Quantile:Number of workers with a commute between 45 and 59 minutes', 'The number of workers over the age of 16 who do not work from home and commute in between 45 and 59 minutes in a geographic area', 0, 'quantile', '0', NULL);
INSERT INTO obs_column (cartodb_id, the_geom, the_geom_webmercator, id, type, name, description, weight, aggregate, version, extra) VALUES (720, NULL, NULL, '"us.census.acs"."us.census.acs".B25081002_quant', 'Numeric', 'Quantile:Owner-occupied Housing Units with a Mortgage', 'The count of housing units within a geographic area that are mortagaged. "Mortgage" refers to all forms of debt where the property is pledged as security for repayment of the debt, including deeds of trust, trust deed, contracts to purchase, land contracts, junior mortgages, and home equity loans.', 0, 'quantile', '0', NULL);
