INSERT INTO obs_column (cartodb_id, the_geom, the_geom_webmercator, id, type, name, description, weight, aggregate, version, extra) VALUES (845, NULL, NULL, '"us.census.acs"."us.census.acs".B14001007_quantile', 'Numeric', 'Quantile:Students Enrolled in Grades 9 to 12', 'The total number of people in each geography currently enrolled in grades 9 through 12 inclusive.  This corresponds roughly to high school.', 0, 'quantile', '0', NULL);
INSERT INTO obs_column (cartodb_id, the_geom, the_geom_webmercator, id, type, name, description, weight, aggregate, version, extra) VALUES (846, NULL, NULL, '"us.census.acs"."us.census.acs".B14001008_quantile', 'Numeric', 'Quantile:Students Enrolled as Undergraduate in College', 'The number of people in a geographic area who are enrolled in college at the undergraduate level. Enrollment refers to being registered or listed as a student in an educational program leading to a college degree. This may be a public school or college, a private school or college.', 0, 'quantile', '0', NULL);
INSERT INTO obs_column (cartodb_id, the_geom, the_geom_webmercator, id, type, name, description, weight, aggregate, version, extra) VALUES (847, NULL, NULL, '"us.census.acs"."us.census.acs".B15003001_quantile', 'Numeric', 'Quantile:Population 25 Years and Over', 'The number of people in a geographic area who are over the age of 25.  This is used mostly as a denominator of educational attainment.', 0, 'quantile', '0', NULL);
INSERT INTO obs_column (cartodb_id, the_geom, the_geom_webmercator, id, type, name, description, weight, aggregate, version, extra) VALUES (848, NULL, NULL, '"us.census.acs"."us.census.acs".B15003017_quantile', 'Numeric', 'Quantile:Population Completed High School', 'The number of people in a geographic area over the age of 25 who completed high school, and did not complete a more advanced degree.', 0, 'quantile', '0', NULL);
INSERT INTO obs_column (cartodb_id, the_geom, the_geom_webmercator, id, type, name, description, weight, aggregate, version, extra) VALUES (849, NULL, NULL, '"us.census.acs"."us.census.acs".B15003019_quantile', 'Numeric', 'Quantile:Population completed less than one year of college, no degree', 'The number of people in a geographic area over the age of 25 who attended college for less than one year and no further.', 0, 'quantile', '0', NULL);
INSERT INTO obs_column (cartodb_id, the_geom, the_geom_webmercator, id, type, name, description, weight, aggregate, version, extra) VALUES (871, NULL, NULL, '"us.census.acs"."us.census.acs".B23008002_quantile', 'Numeric', 'Quantile:Families with young children (under 6 years of age)', '', 0, 'quantile', '0', NULL);
INSERT INTO obs_column (cartodb_id, the_geom, the_geom_webmercator, id, type, name, description, weight, aggregate, version, extra) VALUES (850, NULL, NULL, '"us.census.acs"."us.census.acs".B15003020_quantile', 'Numeric', 'Quantile:Population completed more than one year of college, no degree', 'The number of people in a geographic area over the age of 25 who attended college for more than one year but did not obtain a degree', 0, 'quantile', '0', NULL);
INSERT INTO obs_column (cartodb_id, the_geom, the_geom_webmercator, id, type, name, description, weight, aggregate, version, extra) VALUES (851, NULL, NULL, '"us.census.acs"."us.census.acs".B15003021_quantile', 'Numeric', 'Quantile:Population Completed Associate''s Degree', 'The number of people in a geographic area over the age of 25 who obtained a associate''s degree, and did not complete a more advanced degree.', 0, 'quantile', '0', NULL);
INSERT INTO obs_column (cartodb_id, the_geom, the_geom_webmercator, id, type, name, description, weight, aggregate, version, extra) VALUES (852, NULL, NULL, '"us.census.acs"."us.census.acs".B15003022_quantile', 'Numeric', 'Quantile:Population Completed Bachelor''s Degree', 'The number of people in a geographic area over the age of 25 who obtained a bachelor''s degree, and did not complete a more advanced degree.', 0, 'quantile', '0', NULL);
INSERT INTO obs_column (cartodb_id, the_geom, the_geom_webmercator, id, type, name, description, weight, aggregate, version, extra) VALUES (853, NULL, NULL, '"us.census.acs"."us.census.acs".B15003023_quantile', 'Numeric', 'Quantile:Population Completed Master''s Degree', 'The number of people in a geographic area over the age of 25 who obtained a master''s degree, but did not complete a more advanced degree.', 0, 'quantile', '0', NULL);
INSERT INTO obs_column (cartodb_id, the_geom, the_geom_webmercator, id, type, name, description, weight, aggregate, version, extra) VALUES (854, NULL, NULL, '"us.census.acs"."us.census.acs".B16001001_quantile', 'Numeric', 'Quantile:Population 5 Years and Over', 'The number of people in a geographic area who are over the age of 5.  This is primarily used as a denominator of measures of language spoken at home.', 0, 'quantile', '0', NULL);
INSERT INTO obs_column (cartodb_id, the_geom, the_geom_webmercator, id, type, name, description, weight, aggregate, version, extra) VALUES (855, NULL, NULL, '"us.census.acs"."us.census.acs".B16001002_quantile', 'Numeric', 'Quantile:Speaks only English at Home', 'The number of people in a geographic area over age 5 who speak only English at home.', 0, 'quantile', '0', NULL);
INSERT INTO obs_column (cartodb_id, the_geom, the_geom_webmercator, id, type, name, description, weight, aggregate, version, extra) VALUES (856, NULL, NULL, '"us.census.acs"."us.census.acs".B16001003_quantile', 'Numeric', 'Quantile:Speaks Spanish at Home', 'The number of people in a geographic area over age 5 who speak Spanish at home, possibly in addition to other languages.', 0, 'quantile', '0', NULL);
INSERT INTO obs_column (cartodb_id, the_geom, the_geom_webmercator, id, type, name, description, weight, aggregate, version, extra) VALUES (857, NULL, NULL, '"us.census.acs"."us.census.acs".B17001001_quantile', 'Numeric', 'Quantile:Population for Whom Poverty Status Determined', 'The number of people in each geography who could be identified as either living in poverty or not.  This should be used as the denominator when calculating poverty rates, as it excludes people for whom it was not possible to determine poverty.', 0, 'quantile', '0', NULL);
INSERT INTO obs_column (cartodb_id, the_geom, the_geom_webmercator, id, type, name, description, weight, aggregate, version, extra) VALUES (858, NULL, NULL, '"us.census.acs"."us.census.acs".B17001002_quantile', 'Numeric', 'Quantile:Income In The Past 12 Months Below Poverty Level', 'The number of people in a geographic area who are part of a family (which could be just them as an individual) determined to be "in poverty" following the Office of Management and Budget''s Directive 14. (https://www.census.gov/hhes/povmeas/methodology/ombdir14.html)', 0, 'quantile', '0', NULL);
INSERT INTO obs_column (cartodb_id, the_geom, the_geom_webmercator, id, type, name, description, weight, aggregate, version, extra) VALUES (859, NULL, NULL, '"us.census.acs"."us.census.acs".B19013001_quantile', 'Numeric', 'Quantile:Median Household Income in the past 12 Months', 'Within a geographic area, the median income received by every household on a regular basis before payments for personal income taxes, social security, union dues, medicare deductions, etc.  It includes income received from wages, salary, commissions, bonuses, and tips; self-employment income from own nonfarm or farm businesses, including proprietorships and partnerships; interest, dividends, net rental income, royalty income, or income from estates and trusts; Social Security or Railroad Retirement income; Supplemental Security Income (SSI); any cash public assistance or welfare payments from the state or local welfare office; retirement, survivor, or disability benefits; and any other sources of income received regularly such as Veterans'' (VA) payments, unemployment and/or worker''s compensation, child support, and alimony.', 0, 'quantile', '0', NULL);
INSERT INTO obs_column (cartodb_id, the_geom, the_geom_webmercator, id, type, name, description, weight, aggregate, version, extra) VALUES (861, NULL, NULL, '"us.census.acs"."us.census.acs".B19301001_quantile', 'Numeric', 'Quantile:Per Capita Income in the past 12 Months', '', 0, 'quantile', '0', NULL);
INSERT INTO obs_column (cartodb_id, the_geom, the_geom_webmercator, id, type, name, description, weight, aggregate, version, extra) VALUES (862, NULL, NULL, '"us.census.acs"."us.census.acs".B25001001_quantile', 'Numeric', 'Quantile:Housing Units', 'A count of housing units in each geography.  A housing unit is a house, an apartment, a mobile home or trailer, a group of rooms, or a single room occupied as separate living quarters, or if vacant, intended for occupancy as separate living quarters.', 0, 'quantile', '0', NULL);
INSERT INTO obs_column (cartodb_id, the_geom, the_geom_webmercator, id, type, name, description, weight, aggregate, version, extra) VALUES (863, NULL, NULL, '"us.census.acs"."us.census.acs".B25002003_quantile', 'Numeric', 'Quantile:Vacant Housing Units', 'The count of vacant housing units in a geographic area. A housing unit is vacant if no one is living in it at the time of enumeration, unless its occupants are only temporarily absent. Units temporarily occupied at the time of enumeration entirely by people who have a usual residence elsewhere are also classified as vacant.', 0, 'quantile', '0', NULL);
INSERT INTO obs_column (cartodb_id, the_geom, the_geom_webmercator, id, type, name, description, weight, aggregate, version, extra) VALUES (864, NULL, NULL, '"us.census.acs"."us.census.acs".B25004002_quantile', 'Numeric', 'Quantile:Vacant Housing Units for Rent', 'The count of vacant housing units in a geographic area that are for rent. A housing unit is vacant if no one is living in it at the time of enumeration, unless its occupants are only temporarily absent. Units temporarily occupied at the time of enumeration entirely by people who have a usual residence elsewhere are also classified as vacant.', 0, 'quantile', '0', NULL);
INSERT INTO obs_column (cartodb_id, the_geom, the_geom_webmercator, id, type, name, description, weight, aggregate, version, extra) VALUES (865, NULL, NULL, '"us.census.acs"."us.census.acs".B25004004_quantile', 'Numeric', 'Quantile:Vacant Housing Units for Sale', 'The count of vacant housing units in a geographic area that are for sale. A housing unit is vacant if no one is living in it at the time of enumeration, unless its occupants are only temporarily absent. Units temporarily occupied at the time of enumeration entirely by people who have a usual residence elsewhere are also classified as vacant.', 0, 'quantile', '0', NULL);
INSERT INTO obs_column (cartodb_id, the_geom, the_geom_webmercator, id, type, name, description, weight, aggregate, version, extra) VALUES (866, NULL, NULL, '"us.census.acs"."us.census.acs".B25058001_quantile', 'Numeric', 'Quantile:Median Rent', 'The median contract rent within a geographic area. The contract rent is the monthly rent agreed to or contracted for, regardless of any furnishings, utilities, fees, meals, or services that may be included. For vacant units, it is the monthly rent asked for the rental unit at the time of interview.', 0, 'quantile', '0', NULL);
INSERT INTO obs_column (cartodb_id, the_geom, the_geom_webmercator, id, type, name, description, weight, aggregate, version, extra) VALUES (867, NULL, NULL, '"us.census.acs"."us.census.acs".B25071001_quantile', 'Numeric', 'Quantile:Percent of Household Income Spent on Rent', 'Within a geographic area, the median percentage of household income which was spent on gross rent.  Gross rent is the amount of the contract rent plus the estimated average monthly cost of utilities (electricity, gas, water, sewer etc.) and fuels (oil, coal, wood, etc.) if these are paid by the renter.  Household income is the sum of the income of all people 15 years and older living in the household.', 0, 'quantile', '0', NULL);
INSERT INTO obs_column (cartodb_id, the_geom, the_geom_webmercator, id, type, name, description, weight, aggregate, version, extra) VALUES (868, NULL, NULL, '"us.census.acs"."us.census.acs".B25075001_quantile', 'Numeric', 'Quantile:Owner-occupied Housing Units', '', 0, 'quantile', '0', NULL);
INSERT INTO obs_column (cartodb_id, the_geom, the_geom_webmercator, id, type, name, description, weight, aggregate, version, extra) VALUES (869, NULL, NULL, '"us.census.acs"."us.census.acs".B25075025_quantile', 'Numeric', 'Quantile:Owner-occupied Housing Units valued at $1,000,000 or more.', 'The count of owner occupied housing units in a geographic area that are valued at $1,000,000 or more.  Value is the respondent''s estimate of how much the property (house and lot, mobile home and lot, or condominium unit) would sell for if it were for sale.', 0, 'quantile', '0', NULL);
INSERT INTO obs_column (cartodb_id, the_geom, the_geom_webmercator, id, type, name, description, weight, aggregate, version, extra) VALUES (870, NULL, NULL, '"us.census.acs"."us.census.acs".B25081002_quantile', 'Numeric', 'Quantile:Owner-occupied Housing Units with a Mortgage', 'The count of housing units within a geographic area that are mortagaged. "Mortgage" refers to all forms of debt where the property is pledged as security for repayment of the debt, including deeds of trust, trust deed, contracts to purchase, land contracts, junior mortgages, and home equity loans.', 0, 'quantile', '0', NULL);
